   &oRptDefn.Publish("", "", "", &ProcessInstance);

Else
   If %OutDestType = 3 Then /* Printer */
      &oRptDefn.PrintOutput(%FilePath);
   Else
      If %OutDestType = 5 Then /* Email */
         &bResult = &oRptDefn.EmailOutput(&ProcessInstance);
      End-If;
   End-If;
End-If;

