Local Record &Rec_X_PT3_TAXRP_WRK = GetLevel0()(1).GetRecord(Record.X_PT3_TAXRP_WRK);
Local Record &Rec_X_PT3_TXRP_RCTL = GetLevel0()(1).GetRecord(Record.X_PT3_TXRP_RCTL);
Local Rowset &RS_X_PT3_TAX_EE_VW = GetLevel0()(1).GetRowset(Scroll.X_PT3_TAX_EE_VW);

/* generate the data using the App Class */
Local X_PT3_TAX_REPORT:Tax_Report_Rowset &o_Report_Data = create X_PT3_TAX_REPORT:Tax_Report_Rowset(&Rec_X_PT3_TXRP_RCTL.COMPANY.Value, &Rec_X_PT3_TXRP_RCTL.PAYGROUP.Value, &Rec_X_PT3_TXRP_RCTL.YEAR.Value);

&RS_X_PT3_TAX_EE_VW.Flush();

If &o_Report_Data.FoundTaxDAta Then

   /* populate the page rowset with the data in the Class object */
   &Rec_X_PT3_TAXRP_WRK.GROUPBOX1.Visible = True;

   &o_Report_Data.RowSetData.CopyTo(&RS_X_PT3_TAX_EE_VW);

   &o_Report_Data.Create_File();

   /* diplay the filename from the app class on the page */
   &Rec_X_PT3_TAXRP_WRK.FILE_PATH_NAME.Value = &o_Report_Data.Filename;

   /* intantiate the BI Pub Object */
   &oXML_PUB = create PSXP_RPTDEFNMANAGER:ReportDefn(&Rec_X_PT3_TXRP_RCTL.REPORT_DEFN_ID.Value);
   &oXML_PUB.Get();

   /* tell the report where to find the xml file data source */
   &oXML_PUB.SetRuntimeDataXMLFile(&o_Report_Data.Filename);

   /* Process Report */
   &oXML_PUB.ProcessReport("", "", %Date, "");

   /* save to clear think time functions */
   DoSaveNow();

   /* publish report to new window */
   &oXML_PUB.DisplayOutput();

Else
   &Rec_X_PT3_TAXRP_WRK.GROUPBOX1.Visible = False;


End-If;

